import Layout from './partie1/p16/Layout';
import Test16 from './partie1/p16/p16';
import Test17 from './useContex/P17';
import Carlist from './Lists & conditional Rendering/CarList';
import UseCallback from './useCallback/useCallback';
import UseMemo from './usememo/useMemo';
import Test10 from './partie1/p10/p10';
import Test11 from './partie1/p11';
import UseReducer from './useReducer/useReducer';
import Test18 from './useReducer/productreducer/p10';



const root = ReactDOM.createRoot(document.getElementById('root'));
const fruits = ["orange", "banane", "fraise", "strawberry"];

root.render(
  <React.StrictMode>
    <CustomHooks fruits={fruits} />


